import React from 'react'
import {
  Grid, Header, Divider,
} from 'semantic-ui-react';
import Router from 'next/router';
import Axios from 'axios';
import BenefitsComp from './BenefitsComp';
import ProductLookComp from './ProductLookComp';
import HomeFeaturesComp from './HomeFeaturesComp';
import Api from '../../config/Api';
import StoreComp from '../store/Store';

class HomeComp extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      email: '',
      name: '',
      phone: '',
      emailError: [],
      nameError: [],
      phoneError: [],
      errors: [],
    };
  }


  render() {
    return (
      <div>
          Header
      </div>
    );
  }
}




export default HomeComp;
